using System;using Terrasoft.Core;namespace CreatioCustomServerLogic {    public class MyContactCreator: IExecutor {        public void Execute(UserConnection userConnection) {            /* Retrieve the instance of the [Contacts] schema. */            var schema = userConnection.EntitySchemaManager.GetInstanceByName("Contact");            var length = 10;            for (int i = 0; i < length; i++) {                /* Create a new contact. */                var entity = schema.CreateEntity(userConnection);                /* Set contact properties. */                entity.SetColumnValue("Name", string.Format("Name {0}", i));                entity.SetDefColumnValues();                /* Save the contact to the database. */                entity.Save(false);            }            /* Display a console message. */            Console.WriteLine($ "{length} contacts created");        }    }}